Cells.Services:
- Оказание услуг, выполнение  работ и проведение мероприятий, направленных на содействие трудоустройства, занятости, реализацию государственных программ города Москвы и комплекса мер содействия и расширения сферы занятости и самозанятости;
- Информирование граждан  по вопросам трудоустройства, об  услугах службы занятости, в том  числе при проведении специализированных мероприятий;
- Оказание консультационных  услуг в области содействия занятости и самозанятости граждан, в том числе предпринимательства, ремесленничества, народных промыслов, надомного труда;
- Проведение консультаций  по выбору оптимальной сферы  деятельности граждан, развитию навыков эффективного трудоустройства и адаптации граждан на рынке труда;
- Мониторинг эффективности  мероприятий по оказанию содействия самозанятости граждан, признанных в установленном порядке безработными;
- Осуществление       психологического        консультирования, способствующего снижению психологических проблем в области занятости населения и успешной реализации профессиональной карьеры;
- Проведение мероприятий  по профессиональной ориентации  в
целях совершенствования профессиональных навыков, в том числе по
предоставлению государственных услуг в области содействия занятости
населения, и технологии трудоустройства;
- Оказание методической  помощи безработным гражданам  в разработке бизнес-планов и  подготовке документов для регистрации  предпринимательской деятельности;
- Реализация программ  дополнительного профессионального  образования (программ повышения  квалификации и программ профессиональной переподготовки);
- Осуществление научно-методической деятельности;
- Формирование банка вакансий  с гибкими формами занятости,
по надомному труду, частичной занятости, дистанционной работе;
- Сотрудничество с работодателями  с целью получения
сведений о вакантных должностях и свободных рабочих местах, в том числе
для особо нуждающихся в социальной защите граждан;
- Организация и проведение  мероприятий по вопросам труда  и
содействия занятости населения.
